<script>
	import BlockchainService from "../../services/BlockchainService";
	import {Snackbar} from '../../models/Snackbar'

	export default {
		props:['popup'],
		name: "UnlockKey",
		data(){return {
			password:'',
		}},
		methods:{
			async unlock(){
				const decrypted = await BlockchainService.decryptKey(this.password);
				console.log('decrypted', decrypted);
				if(!decrypted) return Snackbar.error('Password was incorrect.');
				this.popup.data.resolve();
				this.popup.close();
			}
		}
	}
</script>

